DROP TABLE IF EXISTS `order_reserve`;
CREATE TABLE `order_reserve`  (
  `Id` varchar(40) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '预约单号',
  `reserve_user_id` bigint(11) DEFAULT 0 COMMENT '预约用户ID',
