  `house_status` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '预约房屋状态',
  `sex` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '1男 2女',
  `age` int(11) DEFAULT NULL,
  `reserve_time` datetime DEFAULT NULL COMMENT '预约时间',
  `city` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '所在城市',
  `property_location` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '楼盘位置',
  `concat_phone` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '联系方式',
  `description` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '' COMMENT '需求描述',
  `product_id` int(11) DEFAULT NULL COMMENT '商品id',
  `operator_id` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '所属运营商ID',
  `sales_Person_Id` int(11) DEFAULT NULL COMMENT '指定沟通销售人员',
  `installer_id` int(11) DEFAULT NULL COMMENT '指定安装师傅',
  `agreement_ruler_time` datetime DEFAULT NULL COMMENT '约定量尺时间',
  `order_time` datetime DEFAULT NULL COMMENT '下单时间',
  `order_install_time` datetime DEFAULT NULL COMMENT '下派安装单时间',
  `installer_accept_time` datetime DEFAULT NULL COMMENT '安装师傅接单时间',
  `agreement_install_time` datetime DEFAULT NULL COMMENT '与客户约定上门安装时间',
  `status` int(11) DEFAULT 0 COMMENT '状态',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `update_count` int(1) DEFAULT 0 COMMENT '更新预约时间次数',
  `del_flag` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '是否删除0否1是',
  `content` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '备注',
  `finished_time` datetime DEFAULT NULL COMMENT '安装完成时间',
  `product_attr` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '预约商品属性',
  `operator_ischeck` int(255) DEFAULT 0 COMMENT '运营商端是否查看',
  `is_lock` int(11) DEFAULT 0 COMMENT '订单是否被锁定',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '预约订单' ROW_FORMAT = Compact;

